import { Routes, Route, Outlet } from 'react-router-dom';

import Home from './routes/home/home.component';

const Navigation = () => {
	return (
		<div>
			<div>
				<h1>I am Nav bar</h1>
			</div>
			<Outlet />
		</div>
	);
};

const Shop = () => {
	return <h1>I am Sop</h1>;
};
const App = () => {
	return (
		<Routes>
			<Route path="/" element={<Navigation />} />
			<Route path="/" element={<Home />} />
			<Route path="/shop" element={<Shop />} />
		</Routes>
	);
};

export default App;
